import React from 'react';
import Home from './Home';
import About from './About';
import Contact from './Contact';
import {Switch, Route} from 'react-router-dom';

const App = () => {
    return(
        <>
        <Switch>
       <Route path="/" component={Home}/>
       <Route path="/about" component={Home}/>
       <Route path="/" component={Home}/>
       <Route path="/" component={Home}/>
       </Switch>
        </>
    )
}

export default App;
